process.BToKstarEE = cms.EDProducer("BToKstarLLBuilder",
    beamSpot = cms.InputTag("offlineBeamSpot"),
    dileptons = cms.InputTag("electronPairsForKstarEE","SelectedDiLeptons"),
    isoTracksSelection = cms.string('pt > 0.7 && abs(eta)<2.5'),
    kstars = cms.InputTag("KstarToKPi"),
    kstarsTransientTracks = cms.InputTag("tracksBPark","SelectedTransientTracks"),
    leptonTransientTracks = cms.InputTag("electronsForAnalysis","SelectedTransientElectrons"),
    lostTracks = cms.InputTag("lostTracks"),
    postVtxSelection = cms.string('userFloat("sv_prob") > 0.001 && userFloat("fitted_cos_theta_2D") >= 0&& ( (userFloat("fitted_mass") > 4.5 && userFloat("fitted_mass") < 6.)|| (userFloat("fitted_barMass") > 4.5 && userFloat("fitted_barMass") < 6.)  )'),
    preVtxSelection = cms.string('pt > 3. && userFloat("min_dr") > 0.03&& ( (mass < 7. && mass > 4.) || (userFloat("barMass")<7. && userFloat("barMass")>4.) )'),
    tracks = cms.InputTag("packedPFCandidates")
)


